Our mazes are taken from the textgames in the Jericho game suite (Hausknecht et al., 2020  ###reference_b19###). The main release of Jericho includes popular textgames as well as a program that can generate walkthroughs for 56 of them. The original walkthrough of a game is a list of actions (such as east, north, and open door) that one could execute to efficiently complete the game. We enhanced each walkthrough by executing the sequence of actions and augmenting each step with the new observation (i.e., the text feedback that the game engine provides after the action is executed). Unless explicitly specified, the word “walkthrough” refers to the enhanced, but not original, walkthroughs throughout the paper. More details about walkthroughs can be found in section A.1  ###reference_###.

In a walkthrough, not every action triggers a location change: it may update the inventory (such as take lamp and drop pen) or time (such as wait). For each game, we read the walkthrough, labeled the actions that change the locations, and made note of the names of the locations. This annotation is nontrivial and cannot be automated. We had to pay extra attention to appropriately handle the tricky cases, including:

① the name of a location may be mentioned in a rich, but distracting context (e.g., the context may have ten paragraphs and hundreds of words with the name briefly mentioned in the middle);

② a location may be visited multiple times, so we need to assign the same name to all its mentions;

③ different locations may be referred to with the same name in the textual feedback, so we need to rename them in a sensible way.

The location name resolution (see section A.2  ###reference_### for a full procedure) results in a maze for each game. Three of the games have no location change, and so we left them out, resulting in mazes. We store each maze as a directed graph: each node is a named location (e.g., Altar); each directed edge is a movement (e.g., north); and each node-edge-node combination is a location-changing step that was followed in the walkthrough. Note that a graph may be cyclic since the walkthrough may trace back-and-forth between locations.
